<html>
<head>
<style>
#top, #bottom{
position: fixed;
    left: 0;
    right: 0;
    height: 40%;
}

#top {
    top: 0;
    background-color: orange;
}

#bottom {
    bottom: 0;
    background-color: #D2DBED;
}


.wrapper{
  position: fixed;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  text-align: center;
}

.button{
  display: block;
  width: 250px;
  height: 50px;
  line-height: 40px;
  font-size: 24px;
  font-family: sans-serif;
  text-decoration: none;
  color: #D2DBED;
  background-color: #D2DBED;
  border: 2px solid;
  letter-spacing: 3px;
  text-align: center;
  position: relative;
  transition: all .35s;
}

.button span{
  position: relative;
  z-index: 2;
}

.button:after{
  position: absolute;
  content: "";
  top: 0;
  left: 0;
  width: 0;
  height: 100%;
  background: #D2DBED;
  transition: all .35s;
  
}

.button:hover{
  color: #d64611;
}

.button:hover:after{
  width: 100%;
}
</style>
</head>
